/* Fixed Percentage Grid */

// The Fixed Percentage Grid allows to create a grid around the candle.close, with a fixed grid spacing, measured in percentage.
// Default is set to 21, making it 10 grid lines above, and 10 lines below - Easy math -> If your spacing is set to 0.01 (1%), the top line will be 10% above
// starting point and the bottom line will be 10% below the starting point.
// Given that a grid trading strategy is supposed to buy/sell at every grid line, the percentage spacing is calculated from the closest grid, making it visually
// decrease in spacing as it goes lower, and increase as it goes higher (i.e. 100 + 1% = 101 compared with 101 + 1% = 102.1)

let candle = record.current

// Remember that you might have to change the number of records if you choose to use a different variable.totalGrids
variable.totalGrids = 21
variable.spacingPercentage = 0.0075

// Create the variable.array from the candle.close, setting a gridline above every even read, and below every odd read, making it expand from center.
// Grid is created starting with setting a gridline below, meaning that if variable.totalGrids is an even number, there will be one more grid below compared to above.
variable.arr.length = 0
for (i=0; i<variable.totalGrids; i++) {
    let value = 0
    let max = Math.max(...variable.arr)
    let min = Math.min(...variable.arr)
    if (i === 0) {
        value = candle.close
        variable.arr.push(value)
    }
    else {
        if (i/2 === Math.round(i/2)) {
            value = max + (max * variable.spacingPercentage)
            variable.arr.push(value)
        }
        else {
            value = min - (min * variable.spacingPercentage)
            variable.arr.unshift(value)
        }
    }
}

variable.grid0 = Math.min(...variable.arr)   // variable.arr[0]
variable.grid1 = variable.arr[1]             // -9*variable.spacingPercentage
variable.grid2 = variable.arr[2]             // -8*variable.spacingPercentage
