variable.grid18 = variable.arr[18]           // +8*variable.spacingPercentage
variable.grid19 = variable.arr[19]           // +9*variable.spacingPercentage
variable.grid20 = Math.max(...variable.arr)  // variable.arr[20]


variable.gridRange = variable.spacingPercentage * 100

