/* Period Based Grid */

// The ATR Based Grid allows to create a grid considering the current Average True Range. By setting an upper and lower ATR based limit from candle.close,
// and splitting the total range between min and max, into a given number of grid lines.

let candle = record.current

// Remember that you might have to change the number of records if you choose to use a different variable.totalGrids
variable.period = 14 // The default value for lookback period is 14
variable.totalGrids = 21 // Number of grids, including the top and bottom

variable.savedMin.push(candle.min)
if (variable.savedMin.length > variable.period) {
    variable.savedMin.splice(0,1)
}
variable.savedMax.push(candle.max)
if (variable.savedMax.length > variable.period) {
    variable.savedMax.splice(0,1)
}

// Looking up the absolute Min and Max during the historic period
let minRate = Math.min(...variable.savedMin)
let maxRate = Math.max(...variable.savedMax)
let spacing = (maxRate - minRate) / variable.totalGrids

// Create the variable.arr from the bottom to top, setting a grid line after a given spacing.
variable.arr.length = 0
for (i=0; i<variable.totalGrids; i++) {
    let value = 0

    if (i === 0) {
        value = minRate
        variable.arr.push(value)
    }
    else {
        value = variable.arr[i-1] + spacing
        variable.arr.push(value)
    }
}

